io.on('user.session.connect', function (socket, data) {
    var newLocation = {
        x: 0,
        y: 0
    };

    var user = {
        id: socket.id,
        name: data.name,
        location: newLocation,
        color: colors[clients.length]
    };

    clients.push(user);

    socket.emit('map.layout', map);
});

/**
 * User-Movement
 */
io.on('user.movement', function (socket, data) {
    var user = _.find(clients, ['id', userId]);

    if (data.left) {
        --user.location.x
    }
    if (data.right) {
        ++user.location.x
    }
    if (data.up) {
        ++user.location.y
    }
    if (data.down) {
        --user.location.y
    }

    io.emit('users.location.change', user);
});

